import {TextField } from "@mui/material";
import { Stack } from "@mui/system";
import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

export default function SelectLabels() {
  const [age, setGender] = React.useState('');
  const [city, setCity] = React.useState('');

  const handleChange = (event) => {
    setGender(event.target.value);
  };
  const handleChangeCity =(event)=>{
    setCity(event.target.value);

  };

  return (
    <div>
     <Stack direction={"column"} spacing={'2px'} marginLeft={'40%'} marginRight={'40%'} marginTop={'10px'} >
      <TextField   helperText="Please enter your name"  id="name"   label="Name"  />
        <InputLabel id="Gender-label">Gender</InputLabel>
        <Select
          labelId="Gender-label"
          id="Gender"
          value={age}
          label="Gender"
          onChange={handleChange}
        >

          <MenuItem value={"m"}>Male</MenuItem>
          <MenuItem value={"f"}>Female</MenuItem>
        </Select>
        <InputLabel id="City-label">City</InputLabel>
        <Select
          labelId="City-label"
          id="City"
          value={city}
          label="City"
          onChange={handleChangeCity}
        >

          <MenuItem value={"wah cantt"}>wah cantt</MenuItem>
          <MenuItem value={"islamabad"}>islamabad</MenuItem>
        </Select>
     </Stack>
    </div>
  );
}
